import React from 'react';
import './Navigation.css';

const Navigation = ({onRouteChange}) => {
	return (
		<nav style={{'align-content': 'flex-bottom', 'border-bottom': '2px solid blue', display: 'flex', justifyContent: 'flex-end'}} className=''>
			<p onClick={() => onRouteChange('home')} style={{'margin-right': 'auto', 'font-size': '3em'}}className="NavItem">Home</p>
			<p onClick={() => onRouteChange('skills')} className="NavItem">Skills</p>
			<p onClick={() => onRouteChange('projects')} className="NavItem">Projects</p>
			<p onClick={() => onRouteChange('contact')} className="NavItem">Contact</p>
		</nav>
	);
}



